GRP® Tour du Méjean-GR®6a - Portions de la commune de Saint-Pierre-des-Tripiers

En dehors des zones délimitées, le bivouac est autorisé en coeur de parc national dans les conditions cumulatives suivantes:
- pour les randonneurs non motorisés ;
- dans une tente légère ne permettant pas la station debout ou sans tente;
- pour une seule nuit d'affilée ;
- entre 19h le soir et 9h le matin ;
- le long des itinéraires balisés de grande randonnée (GR et GRP) à l'exception des tronçons visés à l'article 2 ;
- à 50 m maximum de chaque côté de l'itinéraire de grande randonnée.


Dans tous les autres cas, le bivouac est interdit dans le cœur du Parc national des Cévennes, considérant qu’il peut entraîner des troubles à la tranquillité des lieux et de la faune sauvage, des risques d'incendie ainsi que des nuisances visuelles.

Pour les bivouaqueurs non motorisés, seuls sont autorisés les feux domestiques au moyen d'un réchaud portatif, à la condition qu'ils soient à plus de deux cents mètres des bois, forêts, plantations et reboisements, dans le respect des arrêtés préfectoraux relatifs au feu.

